B.Xe=new A.ah("We identify content generated by any AI tool such as Chat GPT, Bing AI, Bard, etc. And, that's not the end. We keep on expanding our database. That means when new models and tools are introduced, we will detect them, too.",null,B.x,null,null,null,null,null,null)
B.Xf=new A.ah("5. Detect Mixed AI Content",null,B.b_,null,null,null,null,null,null)
B.Xg=new A.ah("At least for now, AI-generated content is still lagging behind human-generated content in terms of creativity, largely due to the use of repetitive words and sentences. Most AI tools generate content in an over-polite manner with hedging sentences. Such a monotony tone affects the quality as well as user engagement.",null,B.x,null,null,null,null,null,null)
B.Xh=new A.ah(" If your content reads like it was entirely produced by AI, it may affect how search engines rank it.\nUse our free detector to check up to 1,500 characters, and decide if you want to make adjustments before you publish.\n\nAI content detection is only available in the Writer app as an API, and is limited to checks of 1,500 characters at a time. Find out more in our help center article.",null,B.x,B.cW,null,null,null,null,null)
